import './Home.css';
import './components/nav';
import axios from "axios";
import { useEffect, useState } from 'react';

export default function Home() {
  const [name,setName]=useState("jsklaflks");
 useEffect(()=>{
  axios.get('http://localhost:8080/api/users')
  .then((data) => {
    setName(data[0]);
   console.log();
  });
 });

  return (

    <div className="App">
     <nav name={name}/>
    </div>
  );
};
